  import React from 'react';
  import { mdx } from '@mdx-js/react';

  export const frontMatter = {
	id: 'preparation',
	title: 'Testrunner Test Preparation',
	sidebar_label: 'Test Preparation'
};
export const metadata = {
  "unversionedId": "products/testrunner-toolkit/preparation",
  "id": "products/testrunner-toolkit/preparation",
  "isDocsHomePage": false,
  "title": "Testrunner Test Preparation",
  "description": "Before you begin testing with Testrunner Toolkit, you must choose an automation framework.",
  "source": "@site/docs/products/testrunner-toolkit/preparation.md",
  "permalink": "/products/testrunner-toolkit/preparation",
  "editUrl": "https://github.com/saucelabs/sauce-docs/edit/master/docs/products/testrunner-toolkit/preparation.md",
  "lastUpdatedBy": "Author",
  "lastUpdatedAt": 1539502055,
  "sidebar_label": "Test Preparation",
  "sidebar": "docs",
  "previous": {
    "title": "Testrunner Installation",
    "permalink": "/products/testrunner-toolkit/installation"
  },
  "next": {
    "title": "Testrunner Configuration",
    "permalink": "/products/testrunner-toolkit/configuration"
  }
};
  /* @jsx mdx */
import Tabs from '@theme/Tabs';
import TabItem from '@theme/TabItem';
export const rightToc = [{
  value: 'Choose an Automation Framework',
  id: 'choose-an-automation-framework',
  children: []
}, {
  value: 'Run Your First Test',
  id: 'run-your-first-test',
  children: [{
    value: 'Quick demo',
    id: 'quick-demo',
    children: []
  }]
}, {
  value: 'Automation Framework Examples',
  id: 'automation-framework-examples',
  children: []
}];

const layoutProps = {
  rightToc
};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">


    <p>{`Before you begin testing with `}<a parentName="p" {...{
        "href": "/products/testrunner-toolkit"
      }}>{`Testrunner Toolkit`}</a>{`, you must choose an automation framework.`}</p>
    <h2 {...{
      "id": "choose-an-automation-framework"
    }}>{`Choose an Automation Framework`}</h2>
    <ol>
      <li parentName="ol">
        <p parentName="li">{`Run the following command:`}</p>
        <pre parentName="li"><code parentName="pre" {...{
            "className": "language-bash"
          }}>{`saucectl new
`}</code></pre>
      </li>
      <li parentName="ol">
        <p parentName="li">{`Choose the desired framework following the prompt:`}</p>
        <ul parentName="li">
          <li parentName="ul"><a parentName="li" {...{
              "href": "https://github.com/puppeteer/puppeteer"
            }}>{`Puppeteer`}</a></li>
          <li parentName="ul"><a parentName="li" {...{
              "href": "https://github.com/microsoft/playwright"
            }}>{`Playwright`}</a></li>
          <li parentName="ul"><a parentName="li" {...{
              "href": "https://devexpress.github.io/testcafe"
            }}>{`TestCafe`}</a></li>
          <li parentName="ul"><a parentName="li" {...{
              "href": "https://github.com/cypress-io/cypress"
            }}>{`Cypress`}</a></li>
        </ul>
        <p parentName="li">{`Next, the Toolkit will automatically generate: `}</p>
        <ul parentName="li">
          <li parentName="ul">{`a config file (`}<inlineCode parentName="li">{`./sauce/config.yml`}</inlineCode>{`)`}</li>
          <li parentName="ul">{`the `}<inlineCode parentName="li">{`tests`}</inlineCode>{` directory`}</li>
          <li parentName="ul">{`an example test (`}<inlineCode parentName="li">{`tests/example.test.js`}</inlineCode>{`)`}</li>
        </ul>
      </li>
    </ol>
    <h2 {...{
      "id": "run-your-first-test"
    }}>{`Run Your First Test`}</h2>
    <p>{`Run the following command to execute you first test and to ensure Testrunner works properly:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`saucectl run
`}</code></pre>
    <p>{`Testrunner Toolkit will then execute the test based on the information in `}<inlineCode parentName="p">{`config.yml`}</inlineCode>{`. `}</p>
    <p>{`To learn more about how to configure `}<inlineCode parentName="p">{`saucectl`}</inlineCode>{`, please visit the `}<a parentName="p" {...{
        "href": "/products/testrunner-toolkit/configuration"
      }}>{`Configuration`}</a>{` section of the docs. `}</p>
    <h3 {...{
      "id": "quick-demo"
    }}>{`Quick demo`}</h3>
    {
      /*![Demo](https://gist.githubusercontent.com/diemol/f24bb230a0e3b41a052a1d9c1ff41f9e/raw/a325b6c1da77d4d4a804842da7307b055e7b50d2/saucectl-demo.gif)*/
    }
    <p><img alt={"Demo"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./../../assets/saucectl-demo.gif").default} /></p>
    <h2 {...{
      "id": "automation-framework-examples"
    }}>{`Automation Framework Examples`}</h2>
    <p>{`The examples here show how Pipeline testing can be used. Try them and find your own use cases. `}</p>
    <p>{`Every `}<strong parentName="p">{`testrunner`}</strong>{` image comes with a preconfigured setup that allows you to focus on writing tests instead of tweaking with the configurations. Our initial `}<inlineCode parentName="p">{`testrunner`}</inlineCode>{` flavors come either with Puppeteer, Playwright, or TestCafe as an automation framework. `}</p>
    <p>{`Below are example snippets in the following frameworks: `}<a parentName="p" {...{
        "href": "https://pptr.dev/#?product=Puppeteer&version=v3.0.3&show=api-class-browser"
      }}>{`Puppeteer`}</a>{`, `}<a parentName="p" {...{
        "href": "https://playwright.dev/#version=v1.0.1&path=docs%2Fcore-concepts.md&q=browser"
      }}>{`Playwright`}</a>{`, `}<a parentName="p" {...{
        "href": "https://devexpress.github.io/testcafe/documentation/reference/test-api/testcontroller/browser.html"
      }}>{`TestCafe`}</a>{`, and `}<a parentName="p" {...{
        "href": "https://github.com/cypress-io/cypress"
      }}>{`Cypress`}</a>{`.`}</p>
    <Tabs defaultValue="puppeteer" values={[{
      label: 'Puppeteer',
      value: 'puppeteer'
    }, {
      label: 'Playwright',
      value: 'playwright'
    }, {
      label: 'TestCafe',
      value: 'testcafe'
    }, {
      label: 'Cypress',
      value: 'cypress'
    }]} mdxType="Tabs">
      <TabItem value="puppeteer" mdxType="TabItem">
        <p>{`Our Puppeteer testrunner image exposes `}<inlineCode parentName="p">{`browser`}</inlineCode>{` into the global scope which represents an instance of its `}<a parentName="p" {...{
            "href": "https://pptr.dev/#?product=Puppeteer&version=v3.0.4&show=api-class-browser"
          }}><inlineCode parentName="a">{`Browser class`}</inlineCode></a>{`. The browser will be initiated and shutdown by the testrunner setup.`}</p>
        <pre><code parentName="pre" {...{
            "className": "language-js"
          }}>{`describe('saucectl demo test', () => {
    test('should verify title of the page', async () => {
        const page = (await browser.pages())[0]
        await page.goto('https://www.saucedemo.com/');
        expect(await page.title()).toBe('Swag Labs');
    });
});
`}</code></pre>
      </TabItem>
      <TabItem value="playwright" mdxType="TabItem">
        <p>{`The Playwright testrunner image also exposes a global `}<inlineCode parentName="p">{`browser`}</inlineCode>{` variable that represents Playwright's `}<a parentName="p" {...{
            "href": "https://playwright.dev/#version=v1.0.2&path=docs%2Fcore-concepts.md&q=browser"
          }}><inlineCode parentName="a">{`Browser class`}</inlineCode></a>{`. In addition to that you also have access to a pre-generated `}<a parentName="p" {...{
            "href": "https://playwright.dev/#version=v1.0.2&path=docs%2Fcore-concepts.md&q=browser-contexts"
          }}>{`browser context`}</a>{` via `}<inlineCode parentName="p">{`context`}</inlineCode>{` as well as to a `}<a parentName="p" {...{
            "href": "https://playwright.dev/#version=v1.0.2&path=docs%2Fcore-concepts.md&q=pages-and-frames"
          }}>{`page frame`}</a>{` via `}<inlineCode parentName="p">{`page`}</inlineCode>{`.`}</p>
        <pre><code parentName="pre" {...{
            "className": "language-js"
          }}>{`describe('saucectl demo test', () => {
    test('should verify title of the page', async () => {
        await page.goto('https://www.saucedemo.com/');
        expect(await page.title()).toBe('Swag Labs');
    });
});
`}</code></pre>
      </TabItem>
      <TabItem value="testcafe" mdxType="TabItem">
        <pre><code parentName="pre" {...{
            "className": "language-js"
          }}>{`import { Selector } from 'testcafe';
fixture \`Getting Started\`
    .page \`http://devexpress.github.io/testcafe/example\`

const testName = 'testcafe test'
test(testName, async t => {
    await t
        .typeText('#developer-name', 'devx')
        .click('#submit-button')
        .expect(Selector('#article-header').innerText).eql('Thank you, devx!');
});
`}</code></pre>
      </TabItem>
      <TabItem value="cypress" mdxType="TabItem">
        <pre><code parentName="pre" {...{
            "className": "language-js"
          }}>{`context('Actions', () => {
    beforeEach(() => {
        cy.visit('https://example.cypress.io/commands/actions')
    })
    it('.type() - type into a DOM element', () => {
        // https://on.cypress.io/type
        cy.get('.action-email')
            .type('fake@email.com').should('have.value', 'fake@email.com')
    })
})
`}</code></pre>
      </TabItem>
    </Tabs>
    </MDXLayout>;
}

;
MDXContent.isMDXComponent = true;
